PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?instrument ?instrumentLabel WHERE {
  wd:Q154216 wdt:P1303 ?instrument .
  OPTIONAL {
    ?instrument rdfs:label ?instrumentLabel FILTER ( LANG( ?instrumentLabel ) = "en" )
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?org ?label_en ?anyLabel WHERE {
  ?org wdt:P31 wd:Q2401749 .
  ?org wdt:P17 wd:Q31 .
  OPTIONAL {
    ?org rdfs:label ?label_en FILTER ( LANG( ?label_en ) = "en" )
  }
  OPTIONAL {
    ?org rdfs:label ?anyLabel FILTER ( LANG( ?anyLabel ) != "" )
  }
}
ORDER BY ?label_en ?anyLabel

PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
SELECT DISTINCT ?award ?awardLabel ?pointInTime WHERE {
  wd:Q319308 wdt:P166 ?award .
  OPTIONAL {
    ?award rdfs:label ?awardLabel FILTER ( LANG( ?awardLabel ) = "en" )
  }
  OPTIONAL {
    wd:Q319308 p:P166 ?stmt .
    ?stmt ps:P166 ?award .
    OPTIONAL {
      ?stmt pq:P585 ?pointInTime
    }
  }
}
ORDER BY ?awardLabel

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
