SELECT DISTINCT ?lake ?lakeLabel ?country ?countryLabel WHERE {
  VALUES ?lake {
    wd:Q6386177 wd:Q22434937
  }
  OPTIONAL {
    ?lake wdt:P17 ?country .
  }
  OPTIONAL {
    ?lake wdt:P131 * ?admin .
    ?admin wdt:P17 ?country .
  }
  OPTIONAL {
    ?lake rdfs:label ?lakeLabel FILTER ( LANG( ?lakeLabel ) = "en" )
  }
  OPTIONAL {
    ?country rdfs:label ?countryLabel FILTER ( LANG( ?countryLabel ) = "en" )
  }
}
ORDER BY ?lake

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
ASK WHERE {
  wd:Q1144302 ( wdt:P31 | wdt:P171 | wdt:P279 ) + wd:Q10908 .
}
